import React, {Component} from "react"

class MyApp extends Component{

    constructor(){
        super()
        this.state = {
            isLoggin: false
        }
    }

    render(){
        return(
            <div>
                <button>{this.state.isLoggin ? "Log out":"Log in"}</button>
            </div>
        )
    }

}

export default MyApp
